    #print(combined)

    # remove one user's sequence from the emissions array
    #print("Emissions before and after")
    #print(str(emissions.shape))
    emissions = np.delete(emissions, userNum, 0)
    lengths = np.delete(lengths, userNum)
    #print(lengths)
    #print(str(emissions.shape))

    # converting each participant's array into (1,0) shape then concatenate it into the combined array
    for i in emissions:
        temp = i[:, np.newaxis]
        combined = np.concatenate((combined.astype(int), temp.astype(int)))
    #print("Combined shape: ", end="")
    #print(combined.shape)
