    for iteration in range(2): #5 # how many iterations to run for each nComponent value and each person
        for nComponents in range(1,7+1):  # (1,7+1) # we've got 7 categories right now, 0 to 6
            #print("nComponents: " + str(nComponents) + " user:" + str(userNum) + " Iteration: " + str(iteration))
            model = MultinomialHMM(n_components=nComponents, verbose=False, n_iter=100)  # init_params="ste"
            # training model with one user's data removed from the "combined"
            model.fit(combined, lengths)
            #print(model.monitor_)
            iterationData = pd.DataFrame({'nComponents': [nComponents], 'iteration': [iteration], "person (left out during training)": [userNum],
                                          "logLikelihood": [round(model.score(userSequence), 4)],
                                          "monitor_iterations": [model.monitor_.iter]})
            #print(iterationData)
            iterationsData = iterationsData.append(iterationData, ignore_index=True)
